import BookElem from './BookElem/bookElem.jsx';

var sl_im = "data:image/jpeg;base64,";
const BookCatalogPage = () =>{
  return (
    <div className={s.bookCatalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.bookList}>
        <BookElem photo={sl_im} details="Solo-Leveling" rating="10/10" />
        <BookElem photo="" details="Classroom of the Elite" rating="10/10" />
        <BookElem photo="bookcover" details="Overgeared" rating="8/10" />
        <BookElem photo="bookcover" details="It" rating="7/10" />
      </div>
    </div>
  );
}

export default BookCatalogPage;
